import React, { Component } from "react"
import DetailCard from "./DetailCard";


export default class GigsList2 extends Component {
    state = { gigs: [] }

    componentDidMount () {
        fetch("http://localhost:8088/gigs")
        .then(e => e.json())
        .then(gigs => this.setState({ gigs: gigs }))

    }

    render() {
        return (
            <React.Fragment>
                {
                    this.state.gigs.map(gig =>
                        <DetailCard id={gig.id}
                                    name={gig.name}
                                    resource="gigs" />

                    )
                }
            </React.Fragment>
        )
    }
}
